---------------------------------------------
-- Ильназ 28.01.2014
---------------------------------------------
SELECT m.iso, m.local_name, m.id
FROM meta_location m
WHERE m.type = 'CO'

---------------------------------------------
-- Ильназ 28.01.2014
---------------------------------------------
SELECT m.iso, m.local_name, c.CountryID, m.id
FROM meta_location m JOIN Countries c
ON m.in_location = c.id
WHERE m.type = 'RE'

---------------------------------------------
-- Ильназ 28.01.2014
---------------------------------------------
SELECT m.iso, m.local_name, r.RegionID
FROM meta_location m JOIN Regions r
ON m.in_location = r.id
WHERE m.type = 'CI'


---------------------------------------------
-- Ильназ 15.02.2014  Замена локаций с английскими названиями на локации с русскими названиями
---------------------------------------------
DELETE FROM Cities;
DELETE FROM Regions;
DELETE FROM Countries;

ALTER TABLE Countries DROP COLUMN ISO;
SET IDENTITY_INSERT Countries ON;


SET IDENTITY_INSERT Countries OFF;

ALTER TABLE Regions DROP COLUMN ISO;
SET IDENTITY_INSERT Regions ON;


SET IDENTITY_INSERT Regions OFF;

ALTER TABLE Cities DROP COLUMN ISO;
SET IDENTITY_INSERT Cities ON;
ALTER TABLE Cities ADD CountryID INT NOT NULL REFERENCES Countries (CountryID);


SET IDENTITY_INSERT Cities OFF;